import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';




// box for parallax 
function Box(props) {
    return (
        <div className="parallax-container">
            <div className="text">
                <h1>{props.title}</h1>
                <p>{props.description}</p>
            </div>
            <div className={props.cName}>
            </div>

        </div>
    )

}


class Timeline extends React.Component {

    // render parallax box components
    renderBox(name, title, description) {
        return (
            <Box
                cName={name}
                title={title}
            //description={description}
            />
        );
    }

    render() {
        let i = 0;
        return (
            <div>
                {this.renderBox('box box' + (++i)), 'Tree Hacks'}
                {this.renderBox('box box' + (++i)), 'asdf'}
                {this.renderBox('box box' + (++i)), 'asfds'}
            </div>
        );
    }
}





// Top level component 
class TopLevel extends React.Component {

    render() {
        return (
            <Timeline />
        );
    }
}

// ========================================

ReactDOM.render(
    <TopLevel />,
    document.getElementById('root')
);
